ContactSummary.query:
q_con = load "${App.Datasets.SFDC_EA_SP_Contact.FullyQualifiedName}";
q_con = group q_con by ('Id', 'AccountId', 'account.Name', 'Name', 'Title', 'owner.Name');
q_act = load "${App.Datasets.SFDC_EA_SP_Activity.FullyQualifiedName}";
q_act = filter q_act by 'IsClosed' == "true";
q_act = group q_act by 'WhoId';
q_con_act = cogroup q_con by 'Id' left, q_act  by 'WhoId' ;
q_con_act = foreach q_con_act generate q_con.'AccountId' as 'AccountId', q_con.'Id' as 'Id', q_con.'account.Name' as 'account.Name', q_con.'Name' as 'Name', q_con.'Title' as 'Title', q_con.'owner.Name' as 'owner.Name', coalesce(unique(q_act.'Id'), 0) as 'totalActivityCnt';
q_con_act = filter q_con_act by 'totalActivityCnt' {{coalesce(cell(ActivityCntMeasureGroup.selection, 0, "value"), "> -1").asString()}};
q_out = group q_con_act by all;
q_out = foreach q_out generate unique('AccountId') as 'unique_AccountId', unique('Id') as 'unique_Id';

AccountListSummary.query:
q_acc = load "${App.Datasets.SFDC_EA_SP_Account.FullyQualifiedName}";
q_acc = group q_acc by ('Id');
q_act = load "${App.Datasets.SFDC_EA_SP_Activity.FullyQualifiedName}";
q_act = filter q_act by 'IsClosed' == "true";
q_act = group q_act by 'AccountId';
q_acc_act = cogroup q_acc by 'Id' left, q_act  by 'AccountId';
q_acc_act = foreach q_acc_act generate coalesce(unique(q_acc.'Id'), 0) as 'Id', coalesce(unique(q_act.'Id'), 0) as 'totalActivityCnt', coalesce(sum(q_acc.'oppsum.Amount'), 0) as 'totalWonAmount', coalesce(sum(q_acc.'oppsum.WonCnt'), 0) as 'totalWonOppCnt';
q_acc_act = filter q_acc_act by 'totalActivityCnt' {{coalesce(cell(ActivityCntMeasureGroup.selection, 0, "value"), "> -1").asString()}};
q_sum = group q_acc_act by all;
q_sum = foreach q_sum generate sum('Id') as 'accSum', sum('totalActivityCnt') as 'totalActivityCnt', sum('totalWonAmount') as 'totalWonAmount', sum('totalWonOppCnt') as 'totalWonOppCnt';

SubGraphDim1.query:
q_acc = load "${App.Datasets.SFDC_EA_SP_Account.FullyQualifiedName}";
q_acc = group q_acc by ('Id');
q_acc2 = load "${App.Datasets.SFDC_EA_SP_Account.FullyQualifiedName}";
q_acc2 = group q_acc by ('Id', 'SubGraphDim1');
q_act = load "${App.Datasets.SFDC_EA_SP_Activity.FullyQualifiedName}";
q_act = filter q_act by 'IsClosed' == "true";
q_act = group q_act by 'AccountId';
q_acc_act = cogroup q_acc by 'Id' left, q_act  by 'AccountId' left, q_acc2 by 'Id';
q_acc_act = foreach q_acc_act generate q_acc2.'SubGraphDim1' as 'SubGraphDim1', coalesce(unique(q_acc.'Id'), 0) as 'unique_Id', coalesce(unique(q_act.'Id'), 0) as 'totalActivityCnt';
q_acc_act = filter q_acc_act by 'totalActivityCnt' {{coalesce(cell(ActivityCntMeasureGroup.selection, 0, "value"), "> -1").asString()}};
q_out = group q_acc_act by ('SubGraphDim1');
q_out = foreach q_out generate 'SubGraphDim1', sum('unique_Id') as 'unique_Id';
q_out = order q_out by ('unique_Id' desc);

