AccountMainGraph.query:
q_acc = load "${App.Datasets.SFDC_EA_SP_Account.FullyQualifiedName}";
q_acc = group q_acc by ('Id', '{{cell(AccountGraphTypeGroup.selection, 0, "value").asString()}}');
q_acc2 = load "${App.Datasets.SFDC_EA_SP_Account.FullyQualifiedName}";
q_acc2 = group q_acc by ('{{cell(AccountGraphTypeGroup.selection, 0, "value").asString()}}', 'CreatedDate_Year', 'CreatedDate_Month');
q_act = load "${App.Datasets.SFDC_EA_SP_Activity.FullyQualifiedName}";
q_act = filter q_act by 'IsClosed' == "true";
q_act = group q_act by 'AccountId';
q_acc_act = cogroup q_acc by 'Id' left, q_act  by 'AccountId' left, q_acc2 by 'Id';
q_acc_act = foreach q_acc_act generate q_acc2.'{{cell(AccountGraphTypeGroup.selection, 0, "value").asString()}}' as '{{cell(AccountGraphTypeGroup.selection, 0, "value").asString()}}', q_acc2.'CreatedDate_Year' + "~~~" + q_acc2.'CreatedDate_Month' as 'CreatedDate_Year~~~CreatedDate_Month', coalesce(unique(q_acc.'Id'), 0) as 'unique_Id', coalesce(unique(q_act.'Id'), 0) as 'totalActivityCnt';
q_acc_act = filter q_acc_act by 'totalActivityCnt' {{coalesce(cell(ActivityCntMeasureGroup.selection, 0, "value"), "> -1").asString()}};
q_out = group q_acc_act by ('{{cell(AccountGraphTypeGroup.selection, 0, "value").asString()}}', 'CreatedDate_Year~~~CreatedDate_Month');
q_out = foreach q_out generate '{{cell(AccountGraphTypeGroup.selection, 0, "value").asString()}}', 'CreatedDate_Year~~~CreatedDate_Month', sum(unique_Id) as 'AccountCnt', sum(sum(unique_Id)) over([-12..0] partition by 'all' order by 'CreatedDate_Year~~~CreatedDate_Month' asc) as 'GrandTotal';
q_out = order q_out by ('{{cell(AccountGraphTypeGroup.selection, 0, "value").asString()}}', 'CreatedDate_Year~~~CreatedDate_Month' asc);
